let timeStart = 0;
let timeEnd = 0;
let isFlip = false; // sniffer de face de carte
let tryNumber = 0;
let tableauResultList = []; // stockage de la liste des paires valides
let clickToggle = 0; // lui sert à écouter si c'est la première ou deuxième carte (il fait juste 0 => 1 et 1 => 0)
let tableauResultNow = []; // stockage de carte temporaire le temps de la comparaison
let userName = '';
let form = document.querySelector('form');
let girafToggle = false;
let clickTracker = [];
let reveal = false;
let rec = false;
function clearStorage() {
    localStorage.removeItem('tableauResult')
    location.reload();
}

let resultats = JSON.parse(localStorage.getItem('tableauResult'));

if (resultats !== null) {
    resultats = resultats.sort(function (a, b) {
        return a.timeGame - b.timeGame;
    });
}

if (resultats === null) {
    let p = document.createElement('p')
    p.innerText = 'Aucun joueur dans la liste';
    p.className = 'listeVainqueurs'
    form.appendChild(p)
} else {
    let hashOne = document.createElement('h1');
    hashOne.innerText = 'Liste de meilleurs joueurs :';
    hashOne.className = 'leTitre';
    let listeWarrior = document.createElement('ul');
    listeWarrior.className = 'ul';
    let liTab = document.createElement('li');
    liTab.innerText = `Place - nom - score - date`;
    liTab.className = 'listeVainqueurs';
    liTab.setAttribute('style', 'margin-left: auto; margin-right: auto')
    if (resultats.length < 2) {
        let li = document.createElement('li');
        li.className = 'listeVainqueurs';
        li.innerText = `1 ${resultats[0].nom} ${resultats[0].timeGame} ${resultats[0].date}`
        listeWarrior.appendChild(li)
    } else if (resultats.length < 3) {
        for (let i = 0; i < 2; i++) {
            let li = document.createElement('li');
            li.className = 'listeVainqueurs';
            li.innerText = `${i + 1} ${resultats[i].nom} ${resultats[i].timeGame} ${resultats[i].date}`
            listeWarrior.appendChild(li)
        }
    } else {
        for (let i = 0; i < 3; i++) {
            let li = document.createElement('li');
            li.className = 'listeVainqueurs';
            li.innerText = `${i + 1} ${resultats[i].nom} ${resultats[i].timeGame} ${resultats[i].date}`
            listeWarrior.appendChild(li)
        }
    }
    form.append(hashOne, liTab, listeWarrior);
    let button = document.createElement('button')
    button.innerText = 'clear storage';
    button.className = 'theBoutonClear';
    button.onclick = clearStorage;
    form.appendChild(button)
}

form.addEventListener('submit', (e) => {
    e.preventDefault();
    userName = e.target[0].value;
    let p = document.createElement('p')
    p.innerText = userName.toUpperCase();
    p.setAttribute('class', 'theName');
    p.style.display = 'none';
    container.appendChild(p);
});

let theInput = document.getElementById('theInput');
theInput.style.height = "200px";
let theBouton = document.getElementById('theBouton');
theBouton.disabled = true;
theBouton.addEventListener('click', (e) => {
    // console.log(e.target)
    form.style.display = 'none';
    container.style.display = 'block';
    initGame();
})

theInput.addEventListener('input', (e) => { e.target.value === '' ? theBouton.disabled = true : theBouton.disabled = false })

let container = document.querySelector('.container');
container.style.display = 'none';

function setPlate() {
    let theTableau = document.querySelectorAll('.carte')
    theTableau = [].slice.call(theTableau)
    let tableauSrc = ['images/image0.jpeg', 'images/image1.jpeg', 'images/image2.jpeg', 'images/image3.jpeg', 'images/image4.jpeg', 'images/image5.jpeg', 'images/image6.jpeg', 'images/image7.jpeg', 'images/image8.jpeg', 'images/image9.jpeg', 'images/image0.jpeg', 'images/image1.jpeg', 'images/image2.jpeg', 'images/image3.jpeg', 'images/image4.jpeg', 'images/image5.jpeg', 'images/image6.jpeg', 'images/image7.jpeg', 'images/image8.jpeg', 'images/image9.jpeg']
    tableauSrcMelange = shuffle(tableauSrc)
    theTableau.forEach(element => {
        let value = theTableau.indexOf(element)
        element.setAttribute('src', tableauSrcMelange[value])
        element.addEventListener('click', flipCard)
    })
}

const flipCard = (element) => {
    // console.log(element.target)
    if (element.target.getAttribute('src') !== 'images/greta.jpeg') {
        let sourceBase = element.target.getAttribute('src')
        element.target.setAttribute('alt', sourceBase)
        element.target.setAttribute('src', 'images/greta.jpeg')
        element.target.setAttribute('isFlip', false)
    } else {
        let sourceBase = element.target.getAttribute('src')
        let sourceAAfficher = element.target.getAttribute('alt')
        element.target.setAttribute('alt', sourceBase)
        element.target.setAttribute('src', sourceAAfficher)
        element.target.setAttribute('isFlip', true)
    }
}

function initGame() {
    // console.log('on passe dans init game la');
    timeStart = moment();
    rec = false;
    setPlate();
    let theTableau = document.querySelectorAll('.carte');
    theTableau.forEach(element => {
        const image = element.getAttribute("src");
        element.setAttribute('alt', image);
        element.setAttribute('src', 'images/greta.jpeg');
        element.setAttribute('isFlip', isFlip);
    })
}

function resetCards(tableau) {
    setTimeout(() => {
        const firstSrc = tableau[0].getAttribute('src');
        const secondSrc = tableau[1].getAttribute('src');
        const blanked = tableau[0].getAttribute('alt');
        tableau[0].setAttribute('alt', firstSrc);
        tableau[0].setAttribute('src', blanked);
        tableau[0].addEventListener('click', flipCard)
        tableau[0].setAttribute('isflip', false);
        tableau[1].setAttribute('alt', secondSrc);
        tableau[1].setAttribute('src', blanked);
        tableau[1].addEventListener('click', flipCard)
        tableau[1].setAttribute('isflip', false);
    }, 500);
}

function compareCards(tableau) {
    // REGLE LAMA/GORILLE annule carte
    if ((tableau[0].getAttribute('src') === 'images/image9.jpeg') && (tableau[1].getAttribute('src') === 'images/image6.jpeg')) {
        tableauResultList[0].addEventListener('click', flipCard);
        tableauResultList[1].addEventListener('click', flipCard);
        let tableauAreset = [tableauResultList[0], tableauResultList[1]];
        resetCards(tableauAreset);
        const cardRemoved = tableauResultList.shift();
        const cardRemoved2 = tableauResultList.shift();
    }
    // REGLE ECUREUIL/PONEY => GIRAF
    if ((tableau[0].getAttribute('src') === 'images/image4.jpeg') && (tableau[1].getAttribute('src') === 'images/image3.jpeg')) {
        let tableauACheckNow = container.querySelectorAll('img');
        let giraf = []
        for (let index = 0; index < tableauACheckNow.length; index++) {
            if (tableauACheckNow[index].getAttribute('alt') === 'images/image2.jpeg') {
                giraf.push(tableauACheckNow[index])
            }
        }
        if (giraf.length !== 0) {
            if (girafToggle === false) {
                giraf[0].setAttribute('src', 'images/image2.jpeg')
                setTimeout(() => { giraf[0].setAttribute('src', 'images/greta.jpeg') }, 1000)
                girafToggle = true;
            } else {
                giraf[1].setAttribute('src', 'images/image2.jpeg')
                setTimeout(() => { giraf[1].setAttribute('src', 'images/greta.jpeg') }, 1000)
                girafToggle = false;
            }
        }
    }
    // REGLE KANGOUROU/LEMURIEN => reveal
    if ((tableau[0].getAttribute('src') === 'images/image0.jpeg') && (tableau[1].getAttribute('src') === 'images/image8.jpeg')) {
        if (reveal === false) {
            reveal = true;
            let photo = document.querySelectorAll('img')
            photo.forEach(element => {
                if (element.getAttribute('src') === 'images/greta.jpeg') {
                    let source = element.getAttribute('alt');
                    console.log(source);
                    element.setAttribute('src', source)
                    setTimeout(() => {
                        element.setAttribute('src', 'images/greta.jpeg')
                    }, 2000)
                }
            });
        }
    }
    // COMPARAISON CONCRETE
    if (tableau[0].src === tableau[1].src) {
        tryNumber += 1;
        tableauResultList.push(tableau[0], tableau[1]);
        tableau[0].removeEventListener('click', flipCard, false);
        tableau[1].removeEventListener('click', flipCard, false);
    } else {
        tryNumber += 1;
        resetCards(tableau);
    }
    tableau = [];
}

document.addEventListener("click", function (e) {
    if (clickToggle === 0) {
        clickToggle += 1
        let firstCard = e.target;
        firstCard.removeEventListener('click', flipCard, false)
        tableauResultNow.push(firstCard)
        return tableauResultNow;
    } else {
        clickToggle = 0;
        tableauResultNow.push(e.target)
        e.target.removeEventListener('click', flipCard, false)
        compareCards(tableauResultNow)
        tableauResultNow = [];
    }
});

document.addEventListener("click", function (e) {
    clickTracker.push(e.target.getAttribute('id'));
    if (clickTracker.length > 5) {
        clickTracker.shift();
    }
    if (clickTracker[0] === clickTracker[1] && clickTracker[1] === clickTracker[2] && clickTracker[2] === clickTracker[3] && clickTracker[3] === clickTracker[4]) {
        console.log("We <3 REMY");
    }
});
